import React from "react";
import campo from "./campo.css";

function Campo({players}){
    const divs = [];
    for (let i = 0; i < players; i++) {
        divs.push(<div key={i} className="campo-div" />);
    }
    return(
        <div className="campo">
            {divs}
        </div>
    );
}
export {Campo};
